import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
    display: flex;
    height: 100%;
    width: 100%;
    border: 2px solid black;
    flex-direction: row;
    justify-content: center;
    margin-top: 5px;
    border-radius: 5px;
`;

const Card = ({ draggable = false, children }) => {

    return (
        <Wrapper draggable={draggable}>
            {children}
        </Wrapper>
    );
};

export default Card;
